import React, {useState} from 'react';

const Counet = () => {

    const [like, setLikes] = useState(0);
    function increment(){
        setLikes(like +1);
    }

    function decrement(){
        setLikes(like -1);
    }


    return (
        <div>
            <h1>{like}</h1>
            <button onClick={increment}>Plus</button>
            <button onClick={decrement}>Minus</button>
        </div>
    );
};

export default Counet;
